  true,\n\t\"url\": null,\n\t\"notes\": \"Crash Statistics are summarized crash statistics
  for large trucks and buses involved in fatal and non-fatal Crashes that occurred
  in the United States. These statistics are derived from two sources:  the Fatality
  Analysis Reporting System (FARS) and the Motor Carrier Management Information System
  (MCMIS). Crash Statistics contain information that can be used to identify safety
  problems in specific geographical areas or to compare state statistics to the national
  crash figures.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
